      ],
      "mdb-angular-ui-kit/*": [
        "projects/mdb-angular-ui-kit/*"
      ]
    },
    "useDefineForClassFields": false
  }
}

{
  "compilerOptions": {
    "lib": ["dom", "dom.iterable", "esnext"],
    "allowJs": true,
    "skipLibCheck": true,
